import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        padding: "0 20px",
    },
    t1:{
        fontFamily: "SFUIDisplay-Light",
        fontWeight: 300,
        fontSize: "15px",
        lineHeight: "27px",
        marginTop: "100px"
    },
    t2:{
        marginTop: '20px',
        fontFamily: "SFUIDisplay-Light",
        color: "#acacac",
        lineHeight: "33px"
    }
});
export default styles;
